window.bookSummaryJSON = "<p>Ready for your next audiobook? How about almost 40 hours of non-stop action, brought to life by award-winning narrator Kevin Pierce?</p> <p>A corrupt president...A world without power...A handful of survivors battle impossible odds in the madness.</p> <p>The Complete Disruption Trilogy begins with <i>Under a Tell-Tale Sky</i>, McDermott’s acclaimed post-apocalyptic epic. In this pause-resisting thriller, a lone ship carries the world’s most valuable cargo in a world gone violently insane. Can the captain overcome mutiny and betrayal and guide his vessel to safety?</p> <p>Follow a cast of unforgettable characters as they navigate a societal collapse that threatens their very existence. These three pulse-pounding tales paint a harrowing portrait of a frighteningly plausible future, and are sure to keep fans of A.G. Riddle, Hugh Howey, and Justin Cronin resisting to pause long into the night.</p> <p>Get all three audiobooks of the Disruption Trilogy, complete and unabridged in this omnibus edition. That's almost 40 hours of nail biting suspense that Audible listeners have awarded a combined total of over 2,300 reviews with an average rating of 4.7 stars!</p> <p>Don’t wait - grab this deal today!</p>"; 
